script: |
  super -f tsv -I q5164.sql | sort > q5164.out

vector: true

inputs:
  - name: q5164.sql
    data: |
      SELECT - ( 60 ) FROM tab2 WHERE NOT - 70 BETWEEN + col2 * CAST ( col2 AS INTEGER ) AND 30 * CAST ( - 28 AS REAL );
  - name: tab2

outputs:
  - name: q5164.out
    data: |
      -60
      -60
      -60
